import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: `
  <h1>Hello World!</h1>
  <p>This template definition spans multiple lines.</p>
`,
 // styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'myapplication';
}
